    alpha = mixture + ( 2 - 1)*sc[0] + ( 6 - 1)*sc[5] + ( 3 - 1)*sc[13] + ( 1.5 - 1)*sc[14] + ( 2 - 1)*sc[15] + ( 3 - 1)*sc[26];
    /* forward */
    phi_f = sc[1]*sc[12];
    k_f = 1e-06 * 1.39e+16
                * exp(-0.534 * tc[0] - 0.50321666580472 * (536) * invT);
