    phi_r = sc[12];
    Kc = refCinv * exp(g_RT[1] + g_RT[10] - g_RT[12]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[1] + h_RT[10]) + (h_RT[12]) + 1.000000);
